    <p><a parentName="p" {...{
        "href": "https://github.com/nitishm/go-rejson"
      }}>{`Go-ReJSON`}</a>{` is a Go client for RedisJSON Module. It is a Golang client that support multiple Redis clients such as the print-like Redis-api client `}<a parentName="p" {...{
        "href": "/develop/golang/"
      }}>{`redigo`}</a>{` and the type-safe Redis client `}<a parentName="p" {...{
        "href": "/develop/golang/"
      }}>{`go-redis`}</a>{`.`}</p>
    <p>{`Follow the below steps to get started with RedisJSON using Go client.`}</p>
    <h3 {...{
      "id": "step-1-initialise-the-go-module"
    }}>{`Step 1. Initialise the Go module`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` go mod init github.com/my/repo
`}</code></pre>
    <h3 {...{
      "id": "step-2-install-go-redis"
    }}>{`Step 2. Install Go-redis`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` go get github.com/go-redis/redis/v8
`}</code></pre>
    <h3 {...{
      "id": "step-3-install-go-client-for-redisjson"
    }}>{`Step 3. Install Go client for RedisJSON`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` go get github.com/nitishm/go-rejson/v4
`}</code></pre>
    <h3 {...{
      "id": "step-4-clone-the-repository"
    }}>{`Step 4. Clone the repository`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/nitishm/go-rejson
 cd go-rejson/example
`}</code></pre>
    <h3 {...{
      "id": "step-5-build-the-go-package"
    }}>{`Step 5. Build the Go package`}</h3>
    <b>Command:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` go build json_set/json_set.go 
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` go: downloading github.com/go-redis/redis/v8 v8.4.4
 go: downloading github.com/gomodule/redigo v1.8.3
 go: downloading go.opentelemetry.io/otel v0.15.0
 go build: build output "json_set" already exists and is a directory
`}</code></pre>
    <h3 {...{
      "id": "step-6-run-the-go-program"
    }}>{`Step 6. Run the Go program`}</h3>
    <b>Command:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` go run json_set/json_set.go
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` Executing Example_JSONSET for Redigo Client
 Success: OK
 Student read from redis : main.Student{Name:main.Name{First:"Mark", Middle:"S", Last:"Pronto"}, Rank:1}

 Executing Example_JSONSET for Redigo Client
 Success: OK
 Student read from redis : main.Student{Name:main.Name{First:"Mark", Middle:"S", Last:"Pronto"}, Rank:1}
`}</code></pre>
    <b>Command:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` pwd
 go-rejson/examples
`}</code></pre>
    <b>Command:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` go run json_array/json_array.go 
`}</code></pre>
    <b>Result:</b>
    <pre><code parentName="pre" {...{
        "className": "language-go"
      }}>{` Executing Example_JSONSET for Redigo Client
 arr: OK
 arr before pop: [one two three four five]
 Length: 5
 Deleted element: five
 arr after pop: [one two three four]
 Length: 4
 Index of "one": 0
 Out of range: -1
 "ten" not found: -1
 no. of elements left: 2
 arr after trimming to [1,2]: [two three]
 no. of elements: 3
 arr after inserting "one": [one two three]

 Executing Example_JSONSET for Redigo Client
 arr: OK
 arr before pop: [one two three four five]
 Length: 5
 Deleted element: five
 arr after pop: [one two three four]
 Length: 4
 Index of "one": 0
 Out of range: -1
 "ten" not found: -1
 no. of elements left: 2
 arr after trimming to [1,2]: [two three]
 no. of elements: 3
 arr after inserting "one": [one two three]
`}</code></pre>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/develop/golang/"
        }}>{`Go and Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-python"
        }}>{`RedisJSON and Python`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/storing-complex-json-document"
        }}>{`How to store and retrieve nested JSON document`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-nodejs"
        }}>{`Importing JSON data into Redis using NodeJS`}</a>{` `}</li>
      <li parentName="ul">{`Learn more about `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisjson/"
        }}>{`RedisJSON`}</a>{` in the Quickstart tutorial.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/shoppingcart"
        }}>{`How to build shopping cart app using NodeJS and RedisJSON`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redislabs.com/blog/index-and-query-json-docs-with-redis/"
        }}>{`Indexing, Querying, and Full-Text Search of JSON Documents with Redis`}</a></li>
    </ul>
